import Container from '../../Container.jsx';
import './footer.css';



function Footer() {
  return (
     <footer>
<Container>
     <div className="footerbox">
        <div className="contactus">
            <h1>Contact US</h1>
            .
            <h3>Phone</h3>
            <p>+998333733085</p>
        </div>
        <div className="footerlogo">

        </div>
        <div className="utilitypage">

        </div>
     </div>

</Container>
     </footer>
  );
}

export default Footer;
